import './App.css';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Classrooms from './Components/Templates/Classrooms';
import { Classroom } from './Components/Assets/Classroom/Classroom';
import Home from './Classroom/Home/Home';
import Profile from './Classroom/Profile/Profile';
import Modules from './Classroom/Modules/Modules';
import Courses from './Classroom/Courses/Courses';
import Grades from './Classroom/Grades/Grades';
import Tasks from './Classroom/Tasks/Tasks';
import Settings from './Classroom/Settings/Settings';

function App() {
  return (
      <BrowserRouter>
      <Routes>
        {/* Landing Page */}
        <Route path="/" element={<Classrooms />} />

        {/* Classroom with sidebar and nested pages */}
        <Route path="/classroom" element={<Classroom />}>
          {/* Default route redirects to Home */}
          <Route index element={<Navigate to="home" replace />} />

          <Route path="home" element={<Home />} />
          <Route path="profile" element={<Profile />} />
          <Route path="modules" element={<Modules />} />
          <Route path="courses" element={<Courses />} />
          <Route path="grades" element={<Grades />} />
          <Route path="tasks" element={<Tasks />} />
          <Route path="settings" element={<Settings />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
